// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ERC721 {
    mapping(uint256 => address) private _owners;
    mapping(address => uint256) private _balances;

    mapping(uint256 => string) private _tokenURIs;

    string private _name = "Pokemon";
    string private _symbol = "PKM";
    string private _tokenHome = "http://bafybeie55dtiwy3u2eyl2woj7t6p3nhfvezb3y5g247hdnlyfkxgls5agm.ipfs.localhost:8080/";
    uint256 private tokenCount = 0;

    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);

    modifier onlyOwner(uint256 tokenId) {
        require(msg.sender == ownerOf(tokenId), "Not the owner");
        _;
    }

    // Function to get the name of the token
    function name() external view returns (string memory) {
        return _name;
    }

    // Function to get the symbol of the token
    function symbol() external view returns (string memory) {
        return _symbol;
    }

    function balanceOf(address owner) external view returns (uint256) {
        return _balances[owner];
    }

    function ownerOf(uint256 tokenId) public view returns (address) {
        address owner = _owners[tokenId];
        require(owner != address(0), "Owner not found");
        return owner;
    }

    function transfer(address to, uint256 tokenId) external onlyOwner(tokenId) {
        _transfer(msg.sender, to, tokenId);
    }

    function _transfer(address from, address to, uint256 tokenId) internal {
        _owners[tokenId] = to;
        _balances[from]--;
        _balances[to]++;
        emit Transfer(from, to, tokenId);
    }

    function mint(address to, uint256 tokenId, string memory tokenURI) external {
        require(to != address(0), "Cannot mint to zero address");
        // require(_owners[tokenId] == address(0), "Token already minted");

        _balances[to]++;
        _owners[tokenCount] = to;
        _setTokenURI(tokenCount, tokenURI);

        emit Transfer(address(0), to, tokenId);
    }

    function mintEasy(address to) external {
        require(to != address(0), "Cannot mint to zero address");
        // require(_owners[tokenId] == address(0), "Token already minted");

        _balances[to]++;
        _owners[tokenCount] = to;
        _setTokenURI(tokenCount, _tokenHome);

        emit Transfer(address(0), to, tokenCount);
        tokenCount++;
    }

    function _getTokenURI(uint256 tokenId) external view returns(string memory) {
        return _tokenURIs[tokenId];
    }

    function _setTokenURI(uint256 tokenId, string memory tokenURI) internal {
        _tokenURIs[tokenId] = tokenURI;
    }

    function _getTokenCount() external view returns(uint256) {
        return tokenCount;
    }
}
